ame\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"0T--WC4D1C0\",\"title\":\"String Theory and the End of Space and Time with Robbert Dijkgraaf\",\"lengthSeconds\":\"2769\",\"keywords\":[\"science and cocktails\",\"science communication\",\"popular science\",\"science lectures\",\"Science \\u0026 Cocktails\",\"science talks\",\"Brussels\",\"Flagey\",\"Robbert Dijkgraaf\",\"String theory\",\"Black holes\",\"Quantum gravity\",\"Cosmology\",\"Spacetime\",\"Physics\",\"space\",\"time\",\"dijkgraaf\",\"Strings\",\"theoretical physics\",\"mathematical physics\",\"string\",\"theory\",\"spacetime\",\"SCSTRD26082019ams4WDDqPkfe44Kj7rjjuRNxjzz\"],\"channelId\":\"UCNSoT26yvtQi2OIX3wX1azA\",\"isOwnerViewing\":false,\"shortDescription\":\"For more cool science visit http:\/\/www.scienceandcocktails.org\\nIn the framework of the largest string theory conference in the world, Strings 2019, Science and Cocktails organized a special event at Flagey in Brussels. We were sipping cocktails in the art-deco building with string theorist and science superstar Robbert Dijkgraaf as he told us all about the fundamental laws of Nature. Afterwards, cellist and composer Benjamin Glorieux performed a musical piece together with invited guests especially commissioned for the occasion, while live-video artist Klaas Verpoest accompanied them with his visual magic.\\n\\nWhat is string theory? What happens to stuff that falls inside a black hole? What are the fundamental building blocks of space and time? Did Nature have any choice in picking the fundamental laws of physics? What is the role of mathematics in physics?\\n\\nThis talk by professor Robbert Dijkgraaf was recorded on 13 July 2019 at Flagey in Brussels. For more science lectures with dry ice cocktails and live music, visit:\\n\\n• Science \\u0026 Cocktails Brussels\\nWeb: http:\/\/www.scienceandcocktails.org\/bxl\\nContact: bxl@scienceandcocktails.org\\nFacebook: https:\/\/www.facebook.com\/scienceandcocktailsbxl\\nYoutube: https:\/\/www.youtube.com\/playlist?list=PL2c_ujuXhAvREs975xAUl2kN5FcKqkvXS\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/0T--WC4D1C0\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDybw9nAAbkVghquOFDpQHYZz3cNw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/0T--WC4D1C0\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLBYzWf45qiNI5Xn6ZY2V7CXN-z7ng\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/0T--WC4D1C0\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLD4nztGBHRIpjZm-DQt6oqEUdpdQw\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/0T--WC4D1C0\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAJsQ31MVbd720Rfburg7op3p__dg\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/0T--WC4D1C0\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.7696915,\"allowRatings\":true,\"viewCount\":\"578035\",\"author\":\"Science \\u0026 Cocktails\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\": m with his visual magic.\n\nWhat is string theory? What happens to stuff that falls inside a black hole? What are the fundamental building blocks of space and time? Did Nature have any choice in picking the fundamental laws of physics? What is the role of mathematics in physics?\n\nThis talk by professor Robbert Dijkgraaf was recorded on 13 July 2019 at Flagey in Brussels. For more science lectures with dry ice cocktails and live music, visit:\n\n• Science \u0026 Cocktails Brussels\nWeb: "},{"text":"http://www.scienceandcocktails.org/bxl","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMI8LemsoSZ6QIVkvdRCh3ouwK4SK2oj_CCy--f0QE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fwww.scienceandcocktails.org%2Fbxl\u0026event=video_description\u0026v=0T--WC4D1C0\u0026redir_token=pGu8PEwWgnPNNFkgiZNMJT5lGi98MTU4ODY0MTM2M0AxNTg4NTU0OTYz","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fwww.scienceandcocktails.org%2Fbxl\u0026event=video_description\u0026v=0T--WC4D1C0\u0026redir_token=pGu8PEwWgnPNNFkgiZNMJT5lGi98MTU4ODY0MTM2M0AxNTg4NTU0OTYz","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nContact: bxl@scienceandcocktails.org\nFacebook: "},{"text":"https://www.facebook.com/scienceandco...","navigationEndpoint":{"clickTrackingParams":"CJ4BEM2rARgBIhMI8LemsoSZ6QIVkvdRCh3ouwK4SK2oj_CCy--f0QE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.facebook.com%2Fscienceandcocktailsbxl\u0026event=video_description\u0026v=0T--WC4D1C0\u0026redir_token=pGu8PEwWgnPNNFkgiZNMJT5lGi98MTU4ODY0MTM2M0AxNTg4NTU0OTYz","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.facebook.com%2Fscienceandcocktailsbxl\u0026event=video_description\u0026v=0T--WC4D1C0\u0026redir_token=pGu8PEwWgnPNNFkgiZNMJT5lGi98MTU4ODY0MTM2M0AxNTg4NTU0OTYz","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nYoutube: "},{"text":"https://www.youtube.com/playlist?list...","navigationEndpoint":{"clickTrackingParams":"C
